import React, {component} from 'react';
import Dev from './dev';
import devArr from './data.json';

function devList() {
    let devs = devArr.map((dev) => {
        return <Dev company={dev.company} languages={dev.languages}/>
    })
        return (
            <div>
                {devs}
            </div>
    )
}

export default devList;
